import React from 'react'


const Country = ({data, languages}) => {

    const country = data[0];
    const newLanguages = [];
    newLanguages.push(lans)
    const lans = languages.map(language => language)
    console.log('lan.', lans)

    return (
        <>
            <h1>{country.name.common}</h1>
            <p>capital {country.capital}<br />
            population {country.population}
            </p>
            <br />
            <h3>Languages </h3>
            <ul>
                {lans.map((language, index) => { 
                    console.log('language inside', language)
                return(                
                <li key={index}>{language.index}</li>)
                })}
                
            </ul>
            <br />
            <img src={country.flags.png} alt='flag-image' />
        </>
    )
}

export default Country
